import React from 'react';
import styled from 'styled-components';
import InteractionIcon, { getIconData } from '../../../../../InteractionIcon/InteractionIcon';

const Container = styled.div`
  display: flex;
  justify-content: flex-start;
  color: ${props => props.color};
`;

// const StyledInteractionIcon = styled(InteractionIcon)``;

const Circle = styled.div`
  border-radius: 50%;
  background-color: ${props => props.backgroundColor};
`;

const InteractionPair = ({ type, amount, ...interactionProps }) => {
  const { Icon, color, mutedColor } = getIconData(type);
  return (
    <Container color={color}>
      {/* <StyledInteractionIcon type={type} {...interactionProps} /> */}
      <Circle backgroundColor={mutedColor}>
        <InteractionIcon icon={Icon} color={color} mutedColor={mutedColor} />
      </Circle>
      <div>{`#${amount}`}</div>
    </Container>
  );
};

export default InteractionPair;
